import React from "react";
import MobileNavBar from "../Header/MobileNavBar";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { faGithub, faLinkedin } from "@fortawesome/free-brands-svg-icons";

const Footer = () => (
  <div className="bottom-0">
    <MobileNavBar />
    <div className="flex justify-end mr-5">
      <footer>
        <div className="not-fancy-font fixed left-0 right-0 flex justify-center text-white bottom-adjuster">
          <a href="https://zenhabits.net/uncopyright/" target="_">
            uncopyright
          </a>
        </div>
        <div className="flex flex-col gap-5 mb-10">
          <FontAwesomeIcon icon={faGithub} className="text-white text-3xl" />
          <FontAwesomeIcon icon={faLinkedin} className="text-white text-3xl" />
          <FontAwesomeIcon icon={faEnvelope} className="text-white text-3xl" />
        </div>
      </footer>
    </div>
  </div>
);

export default Footer;
